CREATE TABLE visitatore(
id SMALLINT UNSIGNED NOT NULL  AUTO_INCREMENT,
username varchar(20) NOT NULL,
password varchar(255) NOT NULL,
email varchar(50) NOT NULL,
stato boolean NOT NULL,
cognome varchar(20) NOT NULL,
nome varchar(20)NOT NULL,
PRIMARY KEY (id)
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE proprietario(
id SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
username varchar(20) NOT NULL,
password varchar(255) NOT NULL,
email varchar(50) NOT NULL,
stato boolean NOT NULL,
pIVA char(11) NOT NULL,
PRIMARY KEY (id)
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE imgvisitatore(
id SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
data longblob NOT NULL,
type varchar(20) NOT NULL,
idvisitatore SMALLINT UNSIGNED NOT NULL,
PRIMARY KEY (id),
FOREIGN KEY (idvisitatore) REFERENCES visitatore(id) ON DELETE CASCADE ON UPDATE CASCADE
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE imgproprietario(
id SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
data longblob NOT NULL,
type varchar(20) NOT NULL,
idproprietario SMALLINT UNSIGNED NOT NULL,
PRIMARY KEY (id),
FOREIGN KEY (idproprietario) REFERENCES proprietario(id) ON DELETE CASCADE ON UPDATE CASCADE
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE categoria(
id SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
nome varchar(20) NOT NULL,
PRIMARY KEY (id)
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE citta(
id SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
nome varchar(20) NOT NULL,
PRIMARY KEY (id)
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE attivita(
id SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
nome varchar(50) NOT NULL,
descrizione varchar(1000) NOT NULL,
indirizzo varchar(50) NOT NULL,
data DATE NOT NULL,
ora TIME NOT NULL,
visibility tinyint(1) NOT NULL,
idcategoria SMALLINT UNSIGNED NOT NULL,
idcitta SMALLINT UNSIGNED NOT NULL,
idproprietario SMALLINT UNSIGNED NOT NULL,
PRIMARY KEY (id),
FOREIGN KEY (idcategoria) REFERENCES categoria(id) ON DELETE CASCADE ON UPDATE CASCADE,
FOREIGN KEY (idcitta) REFERENCES citta(id) ON DELETE CASCADE ON UPDATE CASCADE,
FOREIGN KEY (idproprietario) REFERENCES proprietario(id) ON DELETE CASCADE ON UPDATE CASCADE
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE imgattivita(
id SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
data longblob NOT NULL,
type varchar(20) NOT NULL,
idattivita SMALLINT UNSIGNED NOT NULL,
PRIMARY KEY (id),
FOREIGN KEY (idattivita) REFERENCES attivita(id) ON DELETE CASCADE ON UPDATE CASCADE
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE valutazione(
id SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
commento varchar(150) NOT NULL,
voto int NOT NULL,
data DATE NOT NULL,
ora TIME NOT NULL,
idattivita SMALLINT UNSIGNED NOT NULL,
idvisitatore SMALLINT UNSIGNED NOT NULL,
PRIMARY KEY (id),
FOREIGN KEY (idattivita) REFERENCES attivita(id) ON DELETE CASCADE ON UPDATE CASCADE,
FOREIGN KEY (idvisitatore) REFERENCES visitatore(id) ON DELETE CASCADE ON UPDATE CASCADE
)ENGINE=InnoDB DEFAULT CHARSET=utf8;


CREATE TABLE imgattmodificate(
id SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
data longblob NOT NULL,
type varchar(20) NOT NULL,
idattivita SMALLINT UNSIGNED NOT NULL,
PRIMARY KEY (id),
FOREIGN KEY (idattivita) REFERENCES attivita(id) ON DELETE CASCADE ON UPDATE CASCADE
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE attivitamodificata(
id SMALLINT UNSIGNED NOT NULL AUTO_INCREMENT,
descrizione varchar(1000) NOT NULL,
indirizzo varchar(50) NOT NULL,
idattivita SMALLINT UNSIGNED NOT NULL,
PRIMARY KEY (id),
FOREIGN KEY (idattivita) REFERENCES attivita(id) ON DELETE CASCADE ON UPDATE CASCADE
)ENGINE=InnoDB DEFAULT CHARSET=utf8;


